import React, { useState } from 'react';
import { StyledSearch, Input } from './styles';

interface ISearchProps {
  className?: string;
}
const Search: React.FC<ISearchProps> = ({ className }) => {
  const [value, setValue] = useState('');

  return (
    <StyledSearch action='/' method='get' className={className}>
      <label className='visually-hidden'>Поиск по сайту</label>
      <Input type='search' name='page-search' placeholder='Поиск по сайту' value={value} onChange={e => setValue(e.target.value)} />
      <button type='submit'>Найти</button>
    </StyledSearch>
  )
};

export default Search;
